import React from 'react';
import QuestionText from './components/questionText';
import './output.css';

function App() {
  return (
    <div className="flex w-full">
      <div className='justify-center'>
      <h1 className="flex text-5xl font-bold">
        What are we building?
      </h1>

      </div>
      <QuestionText />
    </div>
  );
}

export default App;
